        "episode_count": 62,
        "id": 2640,
        "name": "Season 2",
        "overview": "On 5 August 2005, the show was restarted after a four-year hiatus, and renamed Kaun Banega Crorepati Dwitiya or KBC 2. During this season, the top prize amount was doubled to 2 Crore (twenty million) Rupees. It was abruptly ended by STAR Plus after Amitabh Bachchan fell ill in 2006 after he shot his last episode on 13 January 2006.",
