        "id": 49013,
        "name": "Season 2",
        "overview": "All four coaches return for their second season. The season expanded from the first season: each coach has twelve artists on their team, rather than eight as in the first season. The blind auditions and the battle rounds have also been extended.",
        "poster_path": "/xvALjDmiqG9mHH9Apl5DwyXlVwC.jpg",
