        "overview": "Season eighteen of Dancing with the Stars premiered on March 17, 2014. Len Goodman, Carrie Ann Inaba and Bruno Tonioli returned as judges; Tom Bergeron returned as host while Erin Andrews replaced Brooke Burke-Charvet as co-host. Bandleader Ray Chew replaced the Harold Wheeler orchestra and singers.",
        "poster_path": null,
