      "overview": "At the opening party for Equal, Damian's latest business venture, Jerry unexpectedly stumbles upon a very wasted Damian getting up close and personal with one of his employees, Xiao Wei. Left feeling hurt, heartbroken and anguished, a sad and confused Jerry runs away from home only to find solace in the arms of Kao and ends up moving in with his best friend, Brian. Meanwhile, on the other side, an equally sad and anxious Damian is at no peace either and seeks the help of his sister Celine to find a way to win Jerry's trust back and bring him back home.",
