      "overview": "Having had several ups and downs throughout their relationship, Damian and Jerry finally decide to tie the knot so they can be forever one another's and Jerry can finally adopt Kai as his real son. Fast forward to the day of the wedding, all of Damian's and Jerry's family and friends and Kai and Jimmy come together to show their love and support for their lovely union and what touches Jerry the most is their heartfelt, genuine blessings.",
