      "overview": "Formerly a kindergarten teacher, now a farmer and operator of a farm café: Sandra Kochan has been living on a poultry farm in Hunsrück for eight years. For the sake of love. Together with her partner Volker and his two grown-up children, she looks after chickens and, during the season, geese and turkeys. Their \"petting zoo\" also includes three donkeys. 20 hectares of land belong to the farm. Sandra and Volker market the eggs and meat directly from the farm. Slaughtering takes place once a week in their own slaughter room. In addition to a self-service hut on the farm, they sell their products as in the past with an egg car, through the towns on the Rhine and Moselle. Sandra's great passion is the farm café, which she opened three years ago. Every weekend she sells homemade cakes: \"Good things like grandma used to make\". (Text: SWR)",
