        "name": "Season 1",
        "overview": "KBC premiered on 3 July 2000 and was hosted by Amitabh Bachchan, his first appearance on Indian television. KBC initially offered contestants the chance to win 1 Crore (ten million) Indian rupees. The declining ratings of KBC paved way for reformatting the series immediately as Junior KBC with kids as contestants which started airing from 6 May 2001. The season ended on 31 December 2001. The show was well received in its premiere season.",
