        "id": 2641,
        "name": "Season 3",
        "overview": "Star Television recruited Shah Rukh Khan to host the third season of the show when Bachchan declined. The grand prize remained 2 Crore (twenty million) Rupees. The third season of the show began airing on 22 January 2007 with the first contestant as Prasenjit Sarkar who was the last contestant dropped from season two midway owing to Bachchan's health. The show started well but the show's ratings dropped significantly due to the change of the host. The season ended on 19 April 2007 with a special finale.",
