        "name": "Season 4",
        "overview": "During this season, Much like other countries' version of the game, the clock stops whenever a lifeline is used and if the time limit expired, the contestant was forced to walk away with their current winnings. This season introduced the \"Double Dip\" and \"Ask the Expert\" lifelines (similar to the United States counterpart from the Millionaire clock format).",
