        "name": "Season 5",
        "overview": "This season introduced a play at home segment called \"Ghar Baithe Jeeto Jackpot\". This contest allowed home viewers to send an answer to a question via SMS during the show, with 1 Lakh Rupees going to the randomly picked winner, who can double or triple this amount by correctly answering further questions.",
